ommerce\",       \"committee_id\": \"HSIF\",       \"subcommittee\": \"Subcommittee on Health\",       \"subcommittee_id\": \"14\"    },     {      \"activity\": [        \"referral\"      ],       \"committee\": \"House Ways and Means\",       \"committee_id\": \"HSWM\"    },     {      \"activity\": [        \"referral\"      ],       \"committee\": \"House Ways and Means\",       \"committee_id\": \"HSWM\",       \"subcommittee\": \"Subcommittee on Health\",       \"subcommittee_id\": \"02\"    }  ],   \"congress\": \"114\",   \"cosponsors\": [],   \"enacted_as\": \"A real law\",   \"history\": {    \"active\": false,     \"awaiting_signature\": false,     \"enacted\": false,     \"vetoed\": false  },   \"introduced_at\": \"2015-09-24\",   \"number\": \"3609\",   \"official_title\": \"To amend title XVIII of the Social Security Act to modify requirements for payment under the Medicare program for ambulance services furnished by critical access hospitals, and for other purposes.\",   \"popular_title\": null,   \"related_bills\": [],   \"short_title\": null,   \"sponsor\": {    \"bioguide_id\": \"B000575\",     \"district\": \"4\",     \"name\": \"Westerman, Bruce\",     \"state\": \"AR\",     \"thomas_id\": \"02224\",     \"title\": \"Rep\",     \"type\": \"person\"  },   \"status\": \"REFERRED\",   \"status_at\": \"2015-09-24\",   \"subjects\": [    \"Emergency medical services and trauma care\",     \"Health\",     \"Health care coverage and access\",     \"Hospital care\",     \"Licensing and registrations\",     \"Medicare\",     \"Rural conditions and development\"  ],   \"subjects_top_term\": \"Health\",   \"summary\": {    \"as\": \"Introduced in House\",     \"date\": \"2015-09-24T04:00:00Z\",     \"text\": \"This bill amends title XVIII (Medicare) of the Social Security Act to modify requirements for payment under the Medicare program for ambulance services furnished by critical access hospitals (CAHs), which are rural community hospitals that meet specified criteria and receive special payment.\\n\\nUnder current law, ambulance services furnished either by a CAH or by an entity owned or operated by a CAH are paid at a rate of 101% of reasonable costs incurred in furnishing those services, as long as the CAH or entity is the only provider of ambulance services that is located within a 35-mile drive of the CAH. The bill maintains this requirement but further requires that the CAH or entity furnishing the ambulance services be licensed or otherwise authorized to furnish services in the state in which the CAH is located.\"  },   \"titles\": [    {      \"as\": \"introduced\",       \"is_for_portion\": false,       \"title\": \"To amend title XVIII of the Social Security Act to modify requirements for payment under the Medicare program for ambulance services furnished by critical access hospitals, and for other purposes.\",       \"type\": \"official\"    },     {      \"as\": null,       \"is_for_portion\": false,       \"title\": \"To amend title XVIII of the Social Security Act to modify requirements for payment under the Medicare program for ambulance services furnished by critical access hospitals, and for other purposes.\",       \"type\": \"display\"    }  ],   \"updated_at\": \"2016-11-02T22:30:16Z\",   \"url\": \"https://www.gpo.gov/fdsys/bulkdata/BILLSTATUS/114/hr/BILLSTATUS-114hr3609.xml\"}",
